import HomePage from "../pages/HomePage/HomePage";
import TourPage from "../pages/TourPage/TourPage";

const routes = [
  {
    path: "/",
    page: HomePage,
  },
  {
    path: "/tour",
    page: TourPage,
  },
];
export default routes;
